import AssetsList from "./AssetsList"
import { setCollection } from "../store/slices/slice"
import { useDispatch } from "react-redux"
import { useSelector } from "react-redux"

function Markets(){
    const dispatch=useDispatch()
    const lastUpdate=useSelector(state=>state.global.lastUpdate)
    return(
        <div id='markets'>
            <div className="bg-white text-black text-sm p-4 flex ">
               <p className="flex-grow text-lg">Select market</p>
               {lastUpdate&&<p className="flex-grow text-right"><span className="text-xs">last updated:</span> {lastUpdate}<span className="text-lg font-light">  UTC</span></p>}
            </div>
            <div className="flex">
                <button className="bg-sky-500 hover:bg-sky-700 focus:outline-none focus:border-b-2 focus:border-black flex-grow" onClick={()=>dispatch(setCollection('stocks'))}>Stocks</button>
                <button className="bg-sky-500 hover:bg-sky-700 focus:outline-none focus:border-b-2 focus:border-black flex-grow" onClick={()=>dispatch(setCollection('commodities'))}>Commodities</button>
                <button className="bg-sky-500 hover:bg-sky-700 focus:outline-none focus:border-b-2 focus:border-black flex-grow" onClick={()=>dispatch(setCollection('cryptocurrencies'))}>Crypto</button>
            </div>
            <AssetsList/>
        </div>
        
    )
}
export default Markets
